import React, { Component } from "react";

export default class Nav extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        {" "}
        <Link to="/home">About</Link> | <Link to="/product">Product</Link>
        <Outlet />
      </div>
    );
  }
}
